DROP SCHEMA IF EXISTS SEGUROS;
CREATE SCHEMA SEGUROS;
USE SEGUROS;

CREATE TABLE CLIENTE (
	DNI CHAR(9) PRIMARY KEY, 
    NOMBRE VARCHAR(50), 
    FECHA_NACIMIENTO DATE, 
    FECHA_PERMISO DATE,
    
    CONSTRAINT DNI_VALIDO CHECK (DNI RLIKE "[0-9]{8}[A-Z]")
);

CREATE TABLE VEHICULO (
	NUMERO_BASTIDOR CHAR(36) PRIMARY KEY, 
	MATRICULA VARCHAR(8), 
    MARCA VARCHAR(50), 
    MODELO VARCHAR(50), 
    COLOR VARCHAR(20), 
    FECHA_1_MATRICULACION DATE,
    

    CONSTRAINT MATRICULA_VALIDA CHECK 
    (MATRICULA RLIKE "[A-Z]{2}[0-9]{4}[A-Z]{2}" 
	OR MATRICULA RLIKE "[0-9]{4}[BCDFGHJKLMNPQRSTVWXYZ]{3}")
);

CREATE TABLE CLIENTE_ASEGURA_VEHICULO (
	ID INT PRIMARY KEY AUTO_INCREMENT,
	DNI_CLIENTE CHAR(9), 
    NUMERO_BASTIDOR_VEHICULO CHAR(36),
    
    UNIQUE(DNI_CLIENTE, NUMERO_BASTIDOR_VEHICULO),
    
    FOREIGN KEY (DNI_CLIENTE) REFERENCES CLIENTE(DNI),
    FOREIGN KEY (NUMERO_BASTIDOR_VEHICULO) REFERENCES VEHICULO(NUMERO_BASTIDOR)
);

CREATE TABLE POLIZA (
	NUMERO_POLIZA INT PRIMARY KEY AUTO_INCREMENT, 
    ID_VEHICULO_ASEGURADO INT,
    
    FOREIGN KEY (ID_VEHICULO_ASEGURADO) REFERENCES CLIENTE_ASEGURA_VEHICULO (ID)
);

CREATE TABLE COBERTURA (
	CODIGO INT PRIMARY KEY AUTO_INCREMENT, 
    TIPO VARCHAR(50), 
    CUANTIA DECIMAL(6,2)
);

CREATE TABLE SINIESTRO (
	ID INT PRIMARY KEY AUTO_INCREMENT,
    FECHA DATE, 
    LUGAR VARCHAR(50), 
    CAUSA VARCHAR(50), 
    CUANTIA DECIMAL(8,2),
    NUMERO_POLIZA INT,
    
    FOREIGN KEY (NUMERO_POLIZA) REFERENCES POLIZA(NUMERO_POLIZA)
);

CREATE TABLE POLIZA_ASOCIA_COBERTURA (
	NUMERO_POLIZA INT, 
    CODIGO_COBERTURA INT,
    
    PRIMARY KEY (NUMERO_POLIZA, CODIGO_COBERTURA),
    
    FOREIGN KEY (NUMERO_POLIZA) REFERENCES POLIZA(NUMERO_POLIZA),
    FOREIGN KEY (CODIGO_COBERTURA) REFERENCES COBERTURA(CODIGO)
);



SELECT 
    C.DNI,
    V.NUMERO_BASTIDOR
FROM 
    CLIENTE C
    CROSS JOIN VEHICULO V
ORDER BY 
    RAND()
LIMIT 
    500;
    
SELECT
	ID
FROM CLIENTE_ASEGURA_VEHICULO
ORDER BY RAND();

    P.NUMERO_POLIZA,
    C.CODIGO
FROM 
    POLIZA P
    CROSS JOIN COBERTURA C
ORDER BY 
    RAND()
LIMIT 
    1500);
    
